CREATE TABLE `payroll_index` 
(
    `DEPARTMENT_DATA_ID` INT,
    `JOB_DATA_ID` INT,
    `PAYMENT_DATA_ID` INT,
    `RB_DATA_ID` INT,
    `EMPLOYEE_NO` INT,
    FOREIGN KEY (`DEPARTMENT_DATA_ID`) REFERENCES `department`(`DEPARTMENT_DATA_ID`),
    FOREIGN KEY (`JOB_DATA_ID`) REFERENCES `job`(`JOB_DATA_ID`),
    FOREIGN KEY (`PAYMENT_DATA_ID`) REFERENCES `payment`(`PAYMENT_DATA_ID`),
    FOREIGN KEY (`RB_DATA_ID`) REFERENCES `retirement_and_benefits`(`RB_DATA_ID`),
    FOREIGN KEY (`EMPLOYEE_NO`) REFERENCES `employee_info`(`EMPLOYEE_NO`)
);

desc payroll_index;

